import { Link, NavLink } from "react-router-dom";

export default function Header() {
  return (
    <header className="header">
      <h1>
        <Link to="/">SEUNGRI KANG</Link>
      </h1>

      <ul>
        <li>Department</li>
        <li>Youtube</li>
        <li>Gallery</li>
        <li>Location</li>
      </ul>
    </header>
  );
}
